import React from "react";
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom'

function Navbar() {
  return (
    <>
      <section>
      <Router>
      <Routes>
      <Route to></Route>
      </Routes>
      </Router>
     
      </section>
    </>
  );
}

export default Navbar;
